  {
    id: uuid.v4(),
    img: '/jane.jpg',
    name: 'jane lockhead',
    subtitle: 'gym trainer'
  },
  {
    id: uuid.v4(),
    img: '/alex.jpg',
    name: 'alex james',
    subtitle: ''
  },
  {
    id: uuid.v4(),
    img: '/zack.jpg',
    name: 'zack joe',
    subtitle: 'gym trainer'
  }
];

export default trainers;
